import Livro from "../Livro/Livro";
import "./Categoria.css";
function Cateoria(props) {
  console.log(props.livro);
  return (
    <div>
      <h1 className="Categoria"> {props.categoria} </h1>
      <div className="Livros">
        {props.livro.map(() => {
          return (
<Livro />
                    );
        })}
      </div>
    </div>
  );
}

export default Categoria;
